window.bookSummaryJSON = "<p>When bartender Jake Steele finds a portal in an abandoned building, he does what any bored guy would do - he walks through it. He finds himself in a game-like world where his life is measured in stats, and his violence is rewarded with experience points.</p> <p>Under the tutelage of an animal-butchering, whore-loving master, he learns to become an alchemist. He used to mix drinks, but from now on, he's going to be mixing things that are far deadlier.</p> <p><i>Over 400 pages of fantasy LitRPG adventure!</i></p>"; 
